import React from 'react';

const Dummy = () => {
  return (
    <div>
      Hiii Dummy text refers to the bits of content that are used to fill a website mock-up. This text helps web designers better envision how the website will look as a finished product. It is important to understand that dummy text has no meaning whatsoever.
    </div>
  );
}

export default Dummy;
